{
  "general": {
    "name": "Phylolib",
    "description": "PhyloLib is a library."
  },
  "access": {
    "_type": "docker",
    "library": {
      "address": "localhost",
      "port": "5555",
      "dockerDaemon": "",
      "dockerImage": "",
      "dockerContainer": "",
      "dockerVolumes": []
    }
  },
  "library": [
    {
      "name": "Arguments",
      "order": 0,
      "invocation": "-args",
      "allowCommandRep": false,
      "commands": [
        {
          "name": "help",
          "invocation": ["help"]
        },
        {
          "name": "distance",
          "invocation": ["distance"],
          "allowedValues": ["hamming", "grapetree", "kimura"],
          "allowedCommandSets": ["Options"]
        },
        {
          "name": "correction",
          "invocation": ["correction"],
          "allowedValues": ["jukescantor"],
          "allowedCommandSets": ["Options"]
        },
        {
          "name": "algorithm",
          "invocation": ["algorithm"],
          "allowedValues": [
            "goeburst",
            "edmonds",
            "sl",
            "cl",
            "upgma",
            "upgmc",
            "wpgma",
            "wpgmc",
            "saitounei",
            "studierkepler",
            "unj"
          ],
          "allowedCommandSets": ["Options"]
        },
        {
          "name": "optimization",
          "invocation": ["optimization"],
          "allowedValues": ["lbr"],
          "allowedCommandSets": ["Options"]
        }
      ]
    },
    {
      "name": "Options",
      "order": 1,
      "allowCommandRep": true,
      "commands": [
        {
          "name": "File Output",
          "description":
            "Output file as <format>:<location> with format being (asymmetric|symmetric|newick|nexus)",
          "invocation": ["-o", "--out"],
          "allowedValues": ["file"]
        },
        {
          "name": "Dataset Input",
          "description":
            "Input dataset file as <format>:<location> with format being (fasta|ml|snp)",
          "invocation": ["-d", "--dataset"],
          "allowedValues": ["file"]
        },
        {
          "name": "Distance Matrix Input",
          "description":
            "Input distance matrix file as <format>:<location> with format being (asymmetric|symmetric)",
          "invocation": ["-m", "--matrix"],
          "allowedValues": ["file"]
        },
        {
          "name": "Phylogenetic Tree Input",
          "description":
            "Input phylogenetic tree file as <format>:<location> with format being (newick|nexus)",
          "invocation": ["-m", "--matrix"],
          "allowedValues": ["file"]
        },
        {
          "name": "Limit of focus variants",
          "description":
            "Limit of locus variants to consider using goeBURST algorithm [default: 3]",
          "invocation": ["-l", "--lvs"],
          "allowedValues": ["file"]
        }
      ]
    }
  ]
}

{
		"id": "test_workflow",
	  "description": "A test workflow",
		"start_date": "datetime.today()",
		"end_date": "datetime.today()",
		"tasks": [
			{			
			"id": "trimmomatic",
			"type": "container",
			"action": {
				"image": "trimmomatic:latest",
				"api_version": "auto",
        "mounts": [
					{
						"source": "/opt/.fastqTest",
						"target": "/fastq",
						"_type": "bind"
					}
				], 
        "command": "this is my command",
				"auto_remove": true,
        "docker_url": "unix://var/run/docker.sock",
				"network_mode": "bridge"
			},
			"parents": [],
			"children": ["id2", "id3"]
		},
		{			
			"id": "id2",
			"type": "container",
			"action": {
				"image": "step.action.image",
				"api_version": "test",
        "mounts": [{
					"source": "/opt/.fastqTest",
					"target": "/fastq",
					"_type": "bind"
				}],
        "command": "step.action.command",
				"auto_remove": "test",
        "docker_url": "step.action.docker_url",
				"network_mode": "test"
			},	
			"parents": ["id1"],
			"children": ["id4"]
		},
		{				
			"id": "id3",
			"type": "container",
			"action": {
				"image": "step.action.image",
				"api_version": "test",
        "mounts": [{
					"source": "/opt/.fastqTest",
					"target": "/fastq",
					"_type": "bind"
				}],
        "command": "step.action.command",
				"auto_remove": "test",
        "docker_url": "step.action.docker_url",
				"network_mode": "test"
			},		
			"parents": ["id1"],
			"children": ["id4"]
		},
		{		
			"id": "id4",
			"type": "container",
			"action": {
				"image": "step.action.image",
				"api_version": "test",
        "mounts": ["step.action.mounts"],
        "command": "step.action.command",
				"auto_remove": "test",
        "docker_url": "step.action.docker_url",
				"network_mode": "test"
			},		
			"parents": ["id2", "id3"],
			"children": []
		}
	]
}

{  
	"conf": {
		"dagId": "test_dag",
		"tasks": [
			{
				"id": "id1",
				"operator_import": "airflow.providers.docker.operators.docker",
				"operator_type": "DockerOperator",
				"operator_params": {
					"image":"trimmomatic:latest",
					"api_version":"auto",
					"mounts": [
						{
						"target":"/fastq",
						"source":"/opt/.fastqTest",
						"type":"bind"	
						}
					],
					"command": "java -jar /NGStools/Trimmomatic-0.39/trimmomatic.jar PE -phred33 /fastq/sample1_1.fastq /fastq/sample1_2.fastq /fastq/sample1_R1_trimmed.fastq /fastq/sample1_R1_untrimmed.fastq /fastq/sample1_R2_trimmed.fastq /fastq/sample1_R2_untrimmed.fastq ILLUMINACLIP:/NGStools/Trimmomatic-0.39/adapters/TruSeq3-SE.fa:2:30:10",
					"auto_remove": true,
					"docker_url": "unix://var/run/docker.sock",
					"network_mode": "bridge"
				}
			},
			{
				"id": "id2",
				"operator_import": "airflow.providers.docker.operators.docker",
				"operator_type": "DockerOperator",
				"operator_params": {
					"image":"spades:latest",
					"api_version":"auto",
					"mounts": [
						{
						"target":"/fastq",
						"source":"/opt/.fastqTest",
						"type":"bind"	
						}
					],
					"command":"/NGStools/SPAdes-3.14.0-Linux/bin/spades.py -k 21,33,55,77 --careful --only-assembler --pe1-1 /fastq/sample1_R1_trimmed.fastq --pe1-2 /fastq/sample1_R2_trimmed.fastq -o /fastq/fq_spades.fasta",
					"auto_remove": true,
					"docker_url": "unix://var/run/docker.sock",
					"network_mode": "bridge"
				}
			},
			{
				"id": "id3",
				"operator_import": "airflow.providers.docker.operators.docker",
				"operator_type": "DockerOperator",
				"operator_params": {
					"task_id":"abricate",
					"image":"abricate:latest",
					"api_version":"auto",
					"mounts": [
						{
						"target":"/fastq",
						"source":"/opt/.fastqTest",
						"type":"bind"	
						}
					],
					"command":"abricate /fastq/fq_spades.fasta/contigs.fasta --db card --csv",
					"auto_remove": true,
					"docker_url": "unix://var/run/docker.sock",
					"network_mode": "bridge"
				}
			}
		],
		"execution_order": "id1 >> id2 >> id3"
	}	
}
